import * as Yup from 'yup';
import Moment from 'react-moment';
let parseFormats = ['dd/mm/YYYY'];
let invalidDate = new Date('');

export default Yup.date().transform(function(value) {
  value = Moment(value, parseFormats);
  return value.isValid() ? value : invalidDate;
});
